// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

/**
 * @title FoodChainMonitoring
 * @dev Store & retrieve value in a variable
 */
contract Management {
  struct Perms {
    bool can_mint;
    bool can_transfer;
    bool can_receive;
    bool can_split;
    bool can_pack;
  }

  address admin;
  mapping(address => mapping(uint => Perms)) public users_ingridients;
  // A dynamic array to keep track of all unique ingredient IDs
  uint8[] private ingredientIDs;
  // A mapping to check if an ingredient ID is already added to avoid duplicates
  mapping(uint8 => bool) private ingredientIDExists;

  constructor() {
    admin = msg.sender;
  }

  // Function to add a new ingredient ID to the tracking array
  function addIngredientID(uint8 _ingridientID) private {
    if (!ingredientIDExists[_ingridientID]) {
      ingredientIDs.push(_ingridientID);
      ingredientIDExists[_ingridientID] = true;
    }
  }

  function set_user_perms(
    address _user,
    uint8 _ingridientID,
    bool _can_mint,
    bool _can_transfer,
    bool _can_receive,
    bool _can_split,
    bool _can_pack
  ) public {
    require(msg.sender == admin, "Only admin can set perms");
    Perms storage pms = users_ingridients[_user][_ingridientID];
    pms.can_mint = _can_mint;
    pms.can_transfer = _can_transfer;
    pms.can_receive = _can_receive;
    pms.can_split = _can_split;
    pms.can_pack = _can_pack;
    // Add the ingredient ID to the array if it's a new one
    addIngredientID(_ingridientID);
  }

  function get_perm_mint(
    address _user,
    uint8 _ingridientID
  ) public view returns (bool) {
    return users_ingridients[_user][_ingridientID].can_mint;
  }
  function get_perm_transfer(
    address _user,
    uint8 _ingridientID
  ) public view returns (bool) {
    return users_ingridients[_user][_ingridientID].can_transfer;
  }
  function get_perm_receive(
    address _user,
    uint8 _ingridientID
  ) public view returns (bool) {
    return users_ingridients[_user][_ingridientID].can_receive;
  }
  function get_perm_split(
    address _user,
    uint8 _ingridientID
  ) public view returns (bool) {
    return users_ingridients[_user][_ingridientID].can_split;
  }
  function get_perm_pack(
    address _user,
    uint8 _ingridientID
  ) public view returns (bool) {
    return users_ingridients[_user][_ingridientID].can_pack;
  }

  function isAdmin(address _checkAddres) public view returns (bool) {
    return admin == _checkAddres;
  }

  // Public view function to get all tracked ingredient IDs
  function getIngredientIDs() public view returns (uint8[] memory) {
    return ingredientIDs;
  }

  function get_user_perms(
    address _user
  )
    public
    view
    returns (
      bool canMint,
      bool canTransfer,
      bool canReceive,
      bool canSplit,
      bool canPack
    )
  {
    uint8[] memory ingredientIDs = getIngredientIDs(); // This should return an array of all ingredient IDs you're interested in

    for (uint i = 0; i < ingredientIDs.length; i++) {
      Perms storage perms = users_ingridients[_user][ingredientIDs[i]];
      if (perms.can_mint) {
        canMint = true;
      }
      if (perms.can_transfer) {
        canTransfer = true;
      }
      if (perms.can_receive) {
        canReceive = true;
      }
      if (perms.can_split) {
        canSplit = true;
      }
      if (perms.can_pack) {
        canPack = true;
      }

      // If the user can perform all actions, no need to check further
      if (canMint && canTransfer && canReceive && canSplit && canPack) {
        break;
      }
    }

    return (canMint, canTransfer, canReceive, canSplit, canPack);
  }
}
